var collection={};export function documentReady(t){"complete"===document.readyState||"interactive"===document.readyState?setTimeout(t,1):document.addEventListener("DOMContentLoaded",t)}export function loadFileToCollection(t){fetch(t).then(t=>t.json()).then(t=>{collection=t,updateDocument()})}export function loadJsonToCollection(t){collection=JSON.parse(t),updateDocument()}export function pushToCollection(t,e){collection[t]=e,updateDocument()}export function loadObjectToCollection(t){collection=t,updateDocument()}export function getCollection(){return collection}function updateDocument(){document.querySelectorAll('[class^="set-"],[class*=" set-"]').forEach(function(t){t.classList.forEach(function(e){var o=e.replace("set-","");if("inner"==o){var n=t.getAttribute("data-inner");n&&collection[n]&&(t.innerHTML=collection[n])}else{var c=t.getAttribute(`data-${o}`);c&&collection[c]&&(t[o]=collection[c])}})})}